11	65		Preaqueça o forno a 200 ºC (temperatura média). Separe duas assadeiras médias antiaderentes (caso não sejam antiaderentes, unte com uma camada fina de óleo).\n\nColoque a água e o óleo numa panela pequena (ou fervedor) e leve ao fogo médio para ferver. Enquanto isso, numa tigela grande, misture os polvilhos com o sal — atenção ao medir o polvilho: por ser um ingrediente leve, com uma colher, vá enchendo a xícara medidora com polvilho até formar um montinho, e então nivele com a faca.\n\nAssim que a mistura de água e óleo ferver, despeje aos poucos sobre o polvilho para escaldar, misturando bem com uma colher de pau (ou espátula firme), até incorporar todo o líquido. Espere a massa amornar. \n\nMas espere mesmo: se ela estiver quente e você seguir a receita, vai fazer os ovos que serão adicionados cozinhar e o queijo ralado derreter, isso vai fazer o preparo desandar.\nAssim que o polvilho escaldado amornar, adicione o queijo ralado e misture bem com as mãos — nesse momento a massa fica bem pesada; é mais fácil misturar os ingredientes com as mãos.\n\nNuma tigela pequena, quebre um ovo de cada vez e junte à massa — se algum estiver estragado, você não perde a receita. Amasse bem com as mãos a cada adição para incorporar cada ovo totalmente. A textura da massa fica um pouco mais rústica, com gruminhos de polvilho, e pegajosa — não se preocupe, é assim mesmo. O importante é que todos os ingredientes estejam bem misturados, sem que a parte líquida do ovo fique separada da massa.\n\nAntes de modelar os pães de queijo, com uma colher, raspe toda a massa que estiver grudada nas mãos; depois, lave e seque as mãos. Para modelar os pães: coloque um pouco de óleo num pires para untar as mãos; com uma colher, retire uma porção da massa (cerca de 3 colheres [sopa]) e enrole até que fique do tamanho de uma bola de golfe. Transfira o pão de queijo modelado para a assadeira e repita o processo com o restante da massa, deixando espaço entre cada unidade — os pães crescem ao assar.\n\nLeve ao forno para assar por cerca de 40 minutos, até crescer e dourar. Retire do forno e sirva a seguir.		9.2102	1.3	11538.16	342.7386	3.25	62.5858	344.5	61.1	196.17464999999999	256.8942	612.4197	709.074	1118.4678	1518.52	0.39641999915510423	0	5.110670000786782	81.818	0.17454000008940698	1148.24	467.18	3551.36	7.793849999284744	45	459.78	0	0.19740000000000002	0	3.1320000000000006	1.3476	0.7380000000000001	2.3970000000000002	0.327	15	92.16	0	0	476.709	0	123.99	0	8.1	88.5021	1942.6455	0	2745.6	3193.8	5604.3	930.5999999999999	14824.5	0	1649.4	2554.2	3687.3	6788.7	6729.6	2019.3000000000002	3898.8	7317.6	4557	2722.8	967.1999999999999	3663	4961.7	0	364.8857142857143	263.37857142857143	248.67032967032964	320.45714285714286	277.3763736263736	445.57714285714286	259.3142857142857	345.42857142857144	272.6208791208791	2 xícaras (chá) de polvilho azedo\n1 xícara (chá) de polvilho doce\n1½ xícara (chá) de queijo meia-cura ralado grosso\n3 ovos\n1½ xícara (chá) de água\n¼ de xícara (chá) de óleo\n1 colher (chá) de sal\nóleo a gosto para untar as mãos
