14	71		Numa tigela grande, misture a farinha de trigo integral com o sal. Regue com metade da água e misture com a mão, até formar uma farofa grossa.\nAdicione o óleo e misture com as pontas dos dedos.\nAos poucos, junte o restante da água, sovando a massa com a mão. Aperte, amasse, estique e amasse novamente, dentro da tigela, por cerca de 5 minutos, até atingir uma textura macia e elástica. Se preferir sovar na bancada, polvilhe a superfície com uma camada bem fina de farinha de trigo. Mas evite juntar mais farinha na massa. Ela fica bem molenga inicialmente e, à medida que vamos sovando, ela fica no ponto.\nModele a massa numa bola e embale com filme (ou cubra com um pano) e deixe descansar por 10 minutos – esse descanso relaxa o glúten e faz o pão inflar com mais facilidade.\nPolvilhe uma bancada de trabalho com farinha de trigo e faça um rolinho com a massa. Com uma faca (ou espátula) divida em 10 porções. Enrole com as mãos cada pedaço, como se fosse um brigadeiro. Abra a bolinha com o rolo de macarrão, até formar um disco fino – se a massa começar a grudar no rolo ou na bancada polvilhe mais farinha.\nEnquanto abre os discos, aqueça uma frigideira (pode ser de inox ou ferro) em fogo médio, sem untar. Quando estiver quente, coloque o disco de massa e deixe o pão assar por cerca de 20 a 30 segundos, até começar a formar bolhas. Vire o pão e deixe por mais 15 segundos na frigideira. Enquanto isso, acenda uma outra boca do fogão.\nTire o pão da frigideira com uma pinça e coloque diretamente na chama da outra boca do fogão para inflar e chamuscar levemente. Transfira o pão para um prato e repita com o os outros discos. Você também pode finalizar os chapatis na frigideira, basta deixar cozinhar por mais tempo depois de virar.\nSirva a seguir. O chapati vai bem no café da manhã ou no happy hour com pastinhas.		1.805	0	531.8639999999999	87.1631	12.866999999999999	15.9433	83.64999999999999	55.85	2.3699000000000003	3.2698	8.6562	0	16.249799999999997	44.07	0.49433999971